static void
adapter_proxy_finalize (GObject *object)
{
  AdapterProxy *proxy = ADAPTER_PROXY (object);
  g_datalist_clear (&proxy->priv->qdata);
  G_OBJECT_CLASS (adapter_proxy_parent_class)->finalize (object);
}

